import React, { Component } from "react";

function App() {
    return (
      <Router>
        <div>
          <Home />
          <Switch>
            <Route exact path="/" component={Home} />
            <Route exact path="/menu" component={Menu} />
            {/* <Route exact path="/books/:id" component={Detail} /> */}
          </Switch>
        </div>
      </Router>
    );
  }

  export default App;
